  render() {

    let { title, jumbotron } = attributes;
    return (
      <>
        <Layout home title={title}>

          <Head>


          </Head>

          <div className="jumbotron fluid" >

          </div>

        </Layout>

        <style type="text/css"> {
          ` .jumbotron {
            color: white;
